import React, { useState, useEffect } from 'react';
import axios from 'axios';

function List() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const {data : response } = await axios.get('//localhost:8080/songs')
        setData(response);
      } catch (error) {
        console.error(error.message)
      } 
    }
    fetchData();
  }, []);

